    "2016-02-10T06:16:15.558277",nt"name": "o199sc-m77t-and-o199sc-h77t-mgd77t-data-and-header-file-for-single-beam-bathymetry-for-17-1999b0a88",nt"isopen":
    false,nt"url": null,nt"notes": "Single-beam bathymetry data along with
    DGPS navigation data was collected as part of the U.S. Geological Survey cruise
    O-1-99-SC. The cruise was conducted in Southern California from June 5 to June 17,
    1999. The chief scientist was Bill Normark from the USGS Coastal and Marine Geology
    office in Menlo Park, CA. The purpose of this cruise was to study pollution transport
    and accumulation in Santa Monica Bay. The geophysical source was an ODEC 12 kilohertz
    (kHz) echosounder. These data are reformatted from space-delimited ASCII text files
    located in the Coastal and Marine Geology Program (CMGP) InfoBank field activity
    catalog at http://walrus.wr.usgs.gov/infobank/o/o199sc/html/o-1-99-sc.meta.html
    into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
    The MGD77T format includes a header (documentation) file (.h77t) and a data file
    (.m77t). More information regarding this format can be found in the publication
    listed in the Cross_reference section of this metadata file.",nt"license_title":
